//
// Datapath States
//            EN  TC
//   Reg0  0   0   0    => hold (do nothing)
//   Reg1  0   0   1    => hold [do nothing)
//   Reg2  0   1   0    => Decrement (A0 = A0 -1)
//   Reg3  0   1   1    => Load (A0  = D0)
// Registers
//   A0 => Counter register (Initialized to FirstPeriod) 
//   A1 => not used
//   D0 => Reload register (Initialized to Period)
//   D1 => DutyCyle (Initialized to DutyCycle)
//   F0 => not used
//   F1 => not used
// ========================================
